import React, { Component } from "react";
import styles from "./Dashboard.module.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { Sidebar } from "..";

class Dashboard extends Component {
  render() {
    return (
      <>
        {/* Top Navigation Bar */}
        <header className={styles.topnav}>
          <div className={styles.container}>
            <div className={styles.navigation}>
              {/* Navigation: Search Bar [Middle] */}
              <div className={styles.menu}>
                <div className={styles.search}>
                  <input type="search" placeholder="Search Bookings..." />
                  <button
                    className={styles.filter}
                    onclick="toggleVisibility('filter-toggle')"
                  >
                    <i>
                      <FontAwesomeIcon icon="fa-solid fa-filter" />
                    </i>
                  </button>
                  <div className={styles.filterOptions} id="filter-toggle">
                    <div>Option 1</div>
                    <div>Option 2</div>
                    <div>Option 3</div>
                  </div>
                </div>
              </div>

              {/* Navigation: User Login/Sign Up Buttons [Right] */}
              <div className={styles.login}>
                <button
                  className={styles.button}
                  onClick={() => this.props.onShowModal("login")}
                >
                  Login
                </button>
                <button
                  className={[styles.button, styles.buttonPrimary].join(" ")}
                  onClick={() => this.props.onShowModal("sign-up")}
                >
                  Sign Up
                </button>
              </div>
              {/* <div className={styles.login profile}>
            <div className={styles.profile-name}><span>John</span><span>Smith</span></div>
            <div className={styles.profile-icon}><span>JS</span></div>
          </div> */}
            </div>
          </div>
        </header>

        <Sidebar />
      </>
    );
  }
}

export default Dashboard;
